$ser_content = 'a:2:{s:7:"CONTENT";s:0:"";s:4:"VARS";a:3:{i:23646;a:24:{s:2:"ID";s:5:"23646";s:11:"ACTIVE_FROM";s:22:"28 декабря 2015";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:14:"Татьяна";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23646:21";s:20:"PROPERTY_EMAIL_VALUE";s:15:"9150224@mail.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23646:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23646:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:875:"Сегодня 28.12.15,в третий раз посещяла МЦРМ, была процедура Гистероскопия с биопсией, под наркозом. Хочу сказать спасибо, всей бригаде врачей, все четко, вовремя, очень мило и любезно, начиная с регистратура, потом кассы, далее размещение в палате, и самой процедуре. В операционной было как минимум 6 человек, все очень и очень приятные, и не маловажно профессионалы своего дела, настолько слаженная работа, что впечатления остались самые хорошие, и не было не капли волнения!!! СПАСИБО!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23646:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23646:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23646:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23646:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23646:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23826;a:24:{s:2:"ID";s:5:"23826";s:11:"ACTIVE_FROM";s:19:"3 ноября 2017";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:28:"Мазинова Сафие ";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23826:21";s:20:"PROPERTY_EMAIL_VALUE";s:24:"safie.mazinova@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23826:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23826:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1261:"Хочу выразить огромную благодарность Денисовой Валентине Михайловне и всему персоналу этой замечательной клиники:администраторам,медсёстрам.Приехали из Крыма по направлению,боялась ,что отношение будет предвзятое,но к счастью ошиблась.Валентина Михайловна профессионал своего дела,несмотря на свой молодой возраст.Сначала я переживала,не ошиблась ли с выбором врача,но после первого приёма все сомнения отпали сами собой.Мы были во многих клиниках Крыма и Москвы,но такого небезразличного отношения и огромного профессионализма не встречали нигде.Спасибо вам большое,я надеюсь у нас всё получится и мы приедем к вам ещё за детками.Вы подарили нам надежду и веру стать родителями!!!!!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23826:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23826:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23826:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23826:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23826:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23430;a:24:{s:2:"ID";s:5:"23430";s:11:"ACTIVE_FROM";s:24:"27 сентября 2013";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:10:"Елена";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23430:21";s:20:"PROPERTY_EMAIL_VALUE";s:19:"elenaveselova@bk.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23430:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23430:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:689:"Уважаемая, Ольга Евгеньевна! Хочу поблагодарить от всего сердца, за двоих самых долгожданных и самых прекрасных малышей, которые родились 5 августа 2013 года Лизу и Вадюшу. Дай бог, Вам здоровья, процветания и как можно больше таких же счастливых пар, которых осчастливили именно Вы!!! Огромное спасибо за то сча